imult (Neg m) (Neg n) = (Pos (mult (Xsucc m) (Xsucc n)))
idiv (Pos m) (Pos n) = (Pos (xdiv m n))
idiv (Pos m) (Neg n) = (minus (Pos (xdiv m (Xsucc n))))
idiv (Neg m) (Pos n) = (minus (Pos (xdiv (Xsucc m) n)))
idiv (Neg m) (Neg n) = (Pos (xdiv (Xsucc m) (Xsucc n)))
imod (Pos m) (Pos n) = (Pos (xmod m n))
imod (Pos m) (Neg n) = (minus (Pos (xmod (sub (Xsucc n) (xmod m (Xsucc n))) (Xsucc n))))
imod (Neg m) (Pos n) = (Pos (xmod (sub n (xmod (Xsucc m) n)) n))
imod (Neg m) (Neg n) = (minus (Pos (xmod (Xsucc m) (Xsucc n))))
irem (Pos m) j = (Pos (xmod m (xabs j)))
irem (Neg m) j = (minus (Pos (xmod (Xsucc m) (xabs j))))
check_div m n q = (xand (eq (xdiv m n) q) (eq (cdiv m n) q))
check_mod m n q = (xand (eq (xmod m n) q) (eq (cmod m n) q))
check_imult i j k = (ieq (imult i j) k)
check_idiv i j k = (ieq (idiv i j) k)
check_imod i j k = (ieq (imod i j) k)
check_irem i j k = (ieq (irem i j) k)

